Product_Descriptions:
best-selling moisturizing cream for over 40 years, with an iconic, comforting texture. It brings maximum comfort to the face and neck and is ideal for normal to dry skin.


With 96% of ingredients of natural origin, it counteracts moisture loss and preserves the water naturally present in the skin substrate, thanks to its technological-botanical core consisting in:

• IDROATTIVA+ COMPLEX: incorporating hydration and protection. Its special moisturizing active ingredient, containing sugars with inulin, ensures deep hydration for up to 100H, while also guaranteeing optimum internal and external protection thanks to a biomimetic active ingredient that simulates the texture of the skin’s barrier.

• HYPERFERMENTED ITALIAN PEONY now twice as effective, with an anti-pollution, antioxidant and detox action.


The skin is soft, protected from external agents and hydrated for longer.


The IDROATTIVA+ line, with its clean and effective formulas, developed for each skin type, incorporates the very best Collistar research and expertise:

• 100% VEGAN FORMULAS: cruelty-free and without ingredients of animal origin;

• OVER 95% OF NATURAL ORIGIN*: high naturalness for highly tolerable formulas;

• 0% SILICONES: for a non-occlusive effect on the epidermis and skin's barrier;

• Eco-designed packaging: to comply with Collistar’s principles of sustainability and recyclability.
